(587, 260, 'Self-Insurance Program ', '', 'Milliman Robertson', '56,500.00', '23,000.00', '0000-00-00', '1995-09-06', '1995-09-06', '', '\"Quote is all inclusive. CI 9/22/95 - Have not made decision - CI - 10/01 got letter to make another best and final offer due 10/05. CI -10/9/95 - CI 10/16 left message for status of proposal. CI 10/17 per Ms. Paschal, have not made decision. CI 11/14 - Have not made a decision - call back next week. 11/22 - Milliman Robinson - $56,500 (?) not sure - will send copies of evaluation sheets & winning price bid. 11/28 - will send evaluation sheets & winning proposal.         RECEIVED COPIES OF EVALUATION SHEETS & PROPOSAL FROM MILLIMAN.     AMI ORIGINAL BID WAS FOR $28,000 BEST& FINAL OFFER $23,000. MILLIMAN DID NOT CHANGE PRICE QUOTE- MILLIMAN # 1, AMI & WYATT TIED FOR # 2.\"', 'A6-0010', '', '', 0000, '', 0, '', '', '', 0, '', ''),
(588, 369, 'Proposal to Provide Actuarial Consulting Services - WC', '', 'Milliman & Robertson', '245,000.00', '165,000.00', '0000-00-00', '1995-09-12', '1995-09-12', '', 'Quote is all inclusive. 9/22- AMI #4 of 5 - AMI lowest price 9/25/95 CI - sent self-addressed enveloped today for copy of winning proposal. Fax # 904-487-6714 - CI 10/9/95 -fallowed up - she said she ll try to send it today. CI 10/16 - Per Ms. Blue, copies will be mailed today. RECEIVED COPIES.', '96-003-DB', '', '', 0000, '', 0, '', '', '', 0, '', ''),
(589, 314, '(Workers  Compensation Trust Fund) Actuarial Services for the Arizona Industrial Commission - WC	', '', 'Milliman & Robertson', '27,700.00', '17,800.00', '0000-00-00', '1995-09-13', '1995-09-13', '', 'RECEIVED EVALUATION SHEETS & COPY OF WINNING PROPOSAL. AMI RANKED # 2 OF 9 FIRM\\ AMI RANKED # 4 OF LOWEST PRICE RANGE FROM $9,500 - $29,000. One evalualtion sheet critized subcontractor, critized should not have peer review in every step, critized too many methods to estimate losses - should already know the best approach. Critized data requirement of loss listing since inception - (imposible to provide) & cannot provide date on injuries greated than $50,000 by accident year and type of claim. 2nd evaluator said SAMPLE REPORT   appeared generic and may lack detailed desired.  No indication how long the firm has been in existence. FOR MILLIMAN - They were the Funds previous consultant. - 1 FCAS - Michael McMurray previously worked for Fireman s Fund now supervises the studies performed for the State Compensation Fund of both Arizona & California. Very strong experience in Workers  Compensation Fund.', 'A6-0007', '', '', 0000, '', 0, '', '', '', 0, '', ''),
