(648, 401, 'Actuarial Review - 15% Permanent Impairment Threshold', '', 'ARM Tech', '16000', '44000', '0000-00-00', '1996-12-30', '1996-12-30', 'Final decision was PRICE!!. Everybody came close. ARM Tech - $16,000; Delloitte & Touche $25,000, Mercer $38,500; AMI $44,000; Milliman $46.600; Tillinghast $50,000. AMI Scored lowest in interview - 7 of 10. Tillinghast 9; Delloitte 0; ARM Tech 8; Mercer 8; Milliman 8.', '\"$41,000 + $3,000 out-of pocket expenses. Gantt Chart was done before work plan was completed by Bob. Left office Saturday 5:20 PM - Pionex took 1 1/2 hours to print. Almost did not make it to Federal Express. Proposal was not checked. Bob had an interview by phone - call next week. 1/27/97. ---2/19/97 Per Mr. Minkowsky - Final decision was PRICE!!. Everybody came close. ARM Tech - $16,000; Delloitte & Touche $25,000, Mercer $38,500; AMI $44,000; Milliman $46.600; Tillinghast $50,000. AMI Scored lowest in interview - 7 of 10. Tillinghast 9; Delloitte 0; ARM Tech 8; Mercer 8; Milliman 8. Per Mr. Minkowsky - proposal need to be more scpecific in Action Plan (more microscopic in detail). Need to get very detail action plan for the Data Colletion!!!    Because they don t know how to get the data. No other state is using the same system. They will go on proposal again next year. RECEIVED EVALUATION SHEETS BUT DOES NOT WANT TO GIVE WINNING PROPOSAL.\"', '', '', '', 0000, '', 0, '', '', '', 0, '', ''),
(649, 229, 'WC Rate Making Process & The Role of the N.Y. Compensation Ins. Rating Board', '', 'M&R', '', '98660', '0000-00-00', '1996-12-27', '1996-12-27', '', 'maximum- $98,660 - Estimated $70,195 - Selection of Consultant Jan. 10, 1997 - 1/14 - have not made decision - they ll call back next week if they still need us to present our proposal. ---2/7/97 Per Anne Kelly - Chief Casualty Actuary - AMI Ranked # 3 of 3. KPMG ranked # 2. M&R gave very detailed work plan. AMI- # of hours to be spent in ratemaking process and investment income too low; AMI does not have a lot of people; AMI is not located in New York. M&R has more knowledge of New York Rate Making - Each state is very differrent from each other. AMI bid lowest in cost. Would not say how much M&R bid. AMI more suited for Loss Reserve. DOES NOT WANT TO GIVE EVALUATION SHEETS AND COPY OF WINNING PROPOSAL. I SAID THAT I WAS NOT TRYING TO PROTEST TO THEIR DECISION BUT ONLY WANTED TO GET INFO TO EVALUATE AND IMPROVE OUR PROPOSAL -----Requested evaluation sheets & copy of wining proposal via mail to Mr. Jan Goorsky on 2/14/97. 6/02/97 requested again.', '', '', '', 0000, '', 0, '', '', '', 0, '', ''),
