(676, 416, 'Actuarial Consulting Services for Oregon Health Plan Policy & Research', '', 'M&R', '150,000.00', '75,000.00', '0000-00-00', '1998-01-09', '1998-01-09', '', '4/7/98 SENT LETTER M& R Maximum of $90,000 for 1st study & Maximum of $60,000 for 2nd study.        Other bidders include Mercer & DeLoitte Touche.        Feedback:         Although AMI clearly has many qualifications, other three firms have a great deal more experience with setting and analysing Medicaid and commercial capitation rates, Medicaid and commercial costing, 1115 Waiver stes, risk assessment and risk adjustment - specially with Medicaid populations.   The panel eliminated AMI consideration early in the deliberations, and focused on determining which of the other three similarly qualified firms had laid out the best workplan.....          I was initially hesitant to give you another feedback, but I believe it would make your proposals more competitive if spell-check and careful editing were applied to future poposals. If ther is not a strong writer on AMI s staff, it might be helpfull to consider contracting with someone who is proficient writer to edit your products and pro', '', '', '', 0000, '', 0, '', '', '', 0, '', ''),
