(821, 560, 'Actuarial Services', 'GASB 10', '', '', '', '2016-04-01', '0000-00-00', '2016-04-21', 'wasnt able to be delivered', 'Posted by Mario on 4/20/2016:  I was not able to make it to the 10PM deadline of Fedex.  Hayley submitted the initial draft on 4/19.  There were still some missing items (cost, list of top 10 clients, and various forms).  I was not able to review it on 4/19 because I was busy reviewing the final report for Nexus-Trafford and BCBSFL and Agrinational).  When I started to review on 4/20, there were a lot of forms to review with several missing information.  There were several forms that I needed to sign, scan, and include in the PDF file.  I ran out of time.  I tried to call Fedex Same Day service but the earliest delivery time was 10:30AM.  The deadline is 10AM and they give no exception.  The quote from Fedex Same Day services was $340.', '16-03-52', '', '', 2019, 'two one-year extension', 2021, '', 'Hayley', '', 0, '', ''),
