(824, 563, 'Actuarial Services', 'GASB 10', 'Oliver Wyman', '20000', '', '2016-04-11', '0000-00-00', '2016-05-16', '&#61656; AMI demonstrated an understanding and approach to providing the services identified in this request. However, AMI is located in FL and it appears that this is their only office with 12 FT employees with 4 of these being actuaries and 3 of these are FCAS. AMIs sample report appears to be a City in FL disguised as ABC Co. They provided many charts with short explanations and left the reader to interpret the outcomes. AMI appears to have a large client base with only a staff of 12 which may not serve the City well.\r\n&#61656; AON demonstrated sufficiently an understanding and an effective laid out approach to providing the services solicited for proposal. AON is a well-established national firm with over 600 offices worldwide and 61,000 employees. Aon has over 80 Actuarial consultants and 40 Associates and Fellows of the Casualty Actuarial Society. AON has performed similar services for other VA public entities. The work will be performed out of their CA. office. They have done si', '', '2016-5174-0744', 'Oliver Wyman', '', 2018, '3 years', 0, '', 'Arlene/Lloyd', '', 0, 'will be sent from Miami copy in CD is required.  Mailed out by Mario on 5/13/2016.', ''),
